function Footer() {
    return (
        <footer className="page-footer">
            <div className="container">
            <div className="row">
                <div className="col l6 s12">
                <h5 className="white-text">React Shop</h5>
                </div>
            </div>
            </div>
            <div className="footer-copyright">
            <div className="container">
            © 2025
            </div>
            </div>
        </footer>
    );
}
export { Footer };
